<template>
  <div class="log">
    <div class="login_box">
      <p class="title">Alpha喵人工智能教学管理系统</p>
      <div class="input_box">
        <div class="rel input_top">
          <el-input
           
            v-model="form.username"
            placeholder="请输入帐号，8-16位字母+数字、区分大小写"
            class="input"
            @focus="showlight('username')"
            @input="save"
            @blur="hiddenlight"
            auto-complete="new-password"
            :class="showUsername?'input_yes':''"
            @keyup.prevent.enter.native="submitForm"
          ></el-input>
          <img src="../../assets/images/login_ic_user.png" class="icon" alt="logo" />
        </div>
        <div class="rel input_bottom">
          <el-input
           
            autocomplete="on"
            type="password"
            auto-complete="new-password"
            placeholder="请输入密码"
            v-model="form.password"
            show-password
            class="input"
            @focus="showlight('password')"
            @input="save"
            @blur="hiddenlight"
            :class="showPassword?'input_yes':''"
            :style="noPassword?'border:1px solid rgba(255,102,102,1)':''"
            @keyup.prevent.enter.native="submitForm"
          ></el-input>

          <img src="../../assets/images/login_ic_password.png" class="icon" alt="logo" />
        </div>
        <div class="err" v-if="noPassword">
          <img src="../../assets/images/ic_judge_error.png" class="err_img" alt="logo" />
          <span class="err_word">请输入密码！</span>
        </div>
        <div class="err" v-if="retrunErr">
          <img src="../../assets/images/ic_judge_error.png" class="err_img" alt="logo" />
          <span class="err_word">账号或密码错误，请确认后重试！</span>
        </div>
        <el-button
          class="btn"
          :class="showLoginBtn?'':'btn_no'"
          @click.prevent="submitForm"
          :loading="loading"
        >登录</el-button>
      </div>
    </div>
  </div>
</template>

<script>
import { login, addRouter } from "@/api/login"; //从login.js导入login方法
import { getToken, setToken, removeToken } from "@/utils/auth";
import { routes } from "@/router/index";

export default {
  data() {
    return {
      loading: false, //登录按扭加载
      showUsername: false, //用户框高亮
      showPassword: false, //密码框高亮
      showLoginBtn: false, //登录按键高亮
      noPassword: false, //没有填密码，点登录，显示
      retrunErr: false, //请求返回报错，显示
      form: {
        username: "", //用户名
        password: "" //密码
      }
    };
  },
  created() {
    //清掉所有会话存储
    sessionStorage.clear();
  },
  mounted() {},
  methods: {

//  @paste.native.capture.prevent="handlePaste"


    //获得焦点
    showlight(who) {
      if (who === "username") {
        this.showUsername = true;
        this.showPassword = false;
      } else {
        this.showUsername = false;
        this.showPassword = true;
      }
    },

    //失去焦点
    hiddenlight() {
      this.showUsername = false;
      this.showPassword = false;
    },

    //值改变时
    save() {
      let username = this.form.username;
      let password = this.form.password;
      if (username === "") {
        this.showLoginBtn = false;
      } else {
        this.showLoginBtn = true;
      }
    },

    //不能粘贴
    handlePaste() {
      alert("不提供粘贴功能，亲");
    },

    //点击登录
    submitForm() {
      let password = this.form.password;
      let username = this.form.username;
      let that = this;
      //没填用户名，点了没反应
      if (username) {
        //没有密码，提示报红
        if (password) {
          this.noPassword = false;
          if (!this.loading) {
            this.loading = true; //开loading
            login(username, password)
              .then(response => {
                that.$message({
                  message: "登录成功",
                  type: "success",
                  center: true
                });
                //处理返回的数据
                let data = response.data;
                let limit = []; //角色，权限列表
                if (data.sysRoleList[0]) {
                  sessionStorage.setItem("roleName", data.sysRoleList[0].name); //角色名，存会话
                  data.sysRoleList[0].sysMenuList.forEach(item => {
                    let roleCode = item.code;
                    limit.push(roleCode);
                  });
                }
                sessionStorage.setItem("userInfo", JSON.stringify(data));
                sessionStorage.setItem("userId", data.userId);
                sessionStorage.setItem("addressCode", data.addressCode);
                this.$store.dispatch("setName", data.userName);
                this.$store.dispatch("setHeadImage", data.headImage);
                this.$store.dispatch("setRole", limit);
                setToken(data.detailsMap.sessionId);
                //添加路由
                let addLimit = addRouter(limit);
                this.$router.addRoutes(addLimit);
                //跳转
                let homeUrl = addLimit[0].path;
                this.$router.push(homeUrl);
                //关loading
                this.loading = false;
              })
              .catch(err => {
                this.loading = false; //关loading
              });
          }
        } else {
          this.noPassword = true;
        }
      }
    }
  },
  computed: {},
  watch: {}
};
</script>

